import "bootstrap/dist/css/bootstrap.min.css"
import { Container, Jumbotron } from "react-bootstrap";
import "./App.css"



function App() {
  return (
    <div className="App">
      <Container>
        <Jumbotron>
          <h1 className="header">Profile and Account Settings</h1>
        </Jumbotron>
      </Container>
    </div>
  );
}

export default App;
